window.bookSummaryJSON = "<p><b>Megan</b></p> <p>Carson Flynn is dangerous and brooding. Intensely possessive. Angry, fierce. Haunted. </p> <p>He’s a member of the Clan. A criminal. And a single father who’d burn the world for his daughter.</p> <p>But when he turns his eye on me, I know I should run. I should definitely hide. But it’s already too late...</p> <p>Because, when Carson sets his mind on something, he gets what he wants.</p> <p>And what he wants...is me.</p>"; 
